<html>
  <head>
    <link href="../../css/common.css" rel="stylesheet"></link>
    <link rel="stylesheet" type="text/css" href="../../content/auxiliary.css"></link>
    <link href="filing_tools.css" rel="stylesheet"></link>
    <script src="../../third_party/port.js" type="text/javascript"></script>
    <script src="../../js/common/Browser.js" type="text/javascript"></script>
    <script src="../../js/GlobalUtils.js" type="text/javascript"></script>
    <script src="../../js/common/Log.js" type="text/javascript"></script>
    <script src="../../thrift/gen/Limits_types.js" type="text/javascript"></script>
    <script src="NotebookSelector.js" type="text/javascript"></script>
    <script src="TagEntryBox.js" type="text/javascript"></script>
    <script type="text/javascript" src="../UINames.js"></script>
    <script type="text/javascript" src="../MessagePortPrep.js"></script>
    <script src="filing_tools.js" type="text/javascript"></script>
  </head>
  <body>
    <div id="main">
      <div id="title">
        <div class="expandingArea">
          <pre><span></span><br></pre>
          <textarea maxlength="255" tabindex="1"></textarea>
        </div>
      </div>
      <div id="notebook">
        <div class="search">
          <input tabindex="2"/>
          <span class="cancel"></span>
        </div>
        <div class="list"></div>
      </div>
      <div id="tags">
        <input maxlength="100" tabindex="3"/>
        <div id="tagsAutocompleteContainer">
          <div id="tagsAutocomplete"></div>
        </div>
        <div id="existingTags">
          <div id="clearTags"></div>
        </div>
      </div>
      <div class="hidden">
        <div class="divider"></div>
        <div class="divider"></div>
        <div id="comment">
          <div class="expandingArea">
            <pre><span></span><br></pre>
            <textarea tabindex="4"></textarea>
          </div>
        </div>
      </div>
      <div id="url"></div>
    </div>
  </body>
</html>
